
import React from 'react';

import { useAtom } from 'jotai/index';
import {
  useLocation,
  useNavigate,
} from 'react-router-dom';
import toast from 'react-hot-toast';

import {
  Dock,
  DockIcon,
} from '@/components/dock/DockFrame';
import { themeAtom } from '@/store/AppSet';
import { authStateAtom, logoutAtom } from '@/store/AuthState';
import { AuthService } from '@/services/authService';

interface IconProps {
  className: string;
  isDark?: boolean; // 添加 isDark 属性
}


export function DockObject(): React.ReactElement {
  const navigate = useNavigate()
  const location = useLocation()
  // 暗色模式
  const [theme] = useAtom(themeAtom);
  // 认证状态
  const [authState] = useAtom(authStateAtom);
  const [, logout] = useAtom(logoutAtom);
  
  const handleNavigation = (path: string) => {
    navigate(path)
  }

  const handleAuth = async () => {
    if (authState.isAuthenticated) {
      // 已登录，执行登出
      try {
        if (authState.accessToken) {
          await AuthService.logout(authState.accessToken);
        }
        logout();
        toast.success('已成功登出');
        navigate('/auth');
      } catch (error) {
        console.error('Logout failed:', error);
        // 即使登出失败，也清除本地状态
        logout();
        toast.success('已成功登出');
        navigate('/auth');
      }
    } else {
      // 未登录，跳转到登录页
      navigate('/auth');
    }
  }




  return (
    <div className="z-50 bg-background absolute flex bottom-4 left-4 flex-col items-center justify-center rounded-lg h-20">

      <Dock className="relative bg-[rgba(255,255,255)] hover:bg-[rgb(255,255,255)] dark:bg-zinc-800 dark:hover:bg-zinc-700 duration-200 hover:backdrop-blur-xl">

        <DockIcon
          name={authState.isAuthenticated ? '登出' : '登录'}
          designation={
            authState.isAuthenticated 
              ? `${authState.user?.username || '用户'} - 点击登出 👋` 
              : '登录您的账户 🔑'
          }
          id={1}
          onClick={handleAuth}
          className={'bg-neutral-400/20'}
        >
          {authState.isAuthenticated ? (
            <Icons.User className="h-6 w-6 dark:text-white" />
          ) : (
            <Icons.Login className="h-6 w-6 dark:text-white" />
          )}
        </DockIcon>

      </Dock>
    </div>
  )
}
